import { createApp } from 'vue'
import App from './App.vue'
import '@/../public/vendor/jointJS/js/lib/backbone.js'
import '@/../public/vendor/jointJS/js/lib/jquery.js'
import '@/../public/vendor/jointJS/js/lib/lodash.js'
